module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"/releases/10.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/10.0.0","source":"@site/blog/releases/10.0.0/index.mdx","title":"Release 10.0.0","description":"Nya funktioner","date":"2025-05-15T00:00:00.000Z","tags":[],"readingTime":2.335,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.0.0","date":"2025-05-15T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"nextItem":{"title":"Release 9.0.0","permalink":"/pr-preview/pr-594/blog/releases/9.0.0"}},"content":"## Nya funktioner\\n\\nI och med version 10.0 introducerar vi en ny storlek på en rad komponenter, `medium`. Komponenter som berörs och\\nnumera kan användas i både `size=\'large\'` och `size=\'medium\'` är:\\n\\n- [Button](/components/button)\\n- [TextField](/components/textfield)\\n- [SearchField](/components/search-field)\\n- [ComboBox](/components/combobox)\\n- [DatePicker](/components/date-picker)\\n- [DateField](/components/datefield)\\n- [Select](/components/select)\\n\\nDefault size är `\'large\'` i samtliga fall. `large` innebär att inputfältet är 48px högt medan `medium` är 40px, för\\nett mer kompakt utseende.\\n\\n## Migrera från 9.x.x till 10.0.0\\n\\nEn del funktioner har varit deprecated sen 8.x.x eller tidigare och därför tar Midas tillfället i akt att rensa\\nut gammal kod och överflödiga props/funktioner.\\n\\n:::info\\nKontrollera gärna koden innan uppgradering till version 10.x.x för att säkerställa att ni inte använder\\nnågon funktion eller komponent som numera inte fungerar som väntat.\\n:::\\n\\n### Accordion\\n\\nAccordion har inte längre stöd för prop `type` för att ha flera AccordionItems öppna samtidigt. Använd\\n`allowsMultipleExpanded` istället.\\n\\n```diff\\n- <Accordion type=\'multiple\'>/* items */</Accordion>\\n+ <Accordion allowsMultipleExpanded>/* items */</Accordion>\\n```\\n\\n### Button\\n\\nButton har inte längre stöd för `size=\'small\'`. Däremot introduceras storleken `medium` och det går att välja\\nmellan `\'large\'` och `\'medium\'`, där large är default.\\n\\n```diff\\n//highlight-next-line\\n-   <Button size=\'small\'></Button> // this is no longer valid\\n+   <Button size=\'medium\'></Button>\\n\\n```\\n\\n### Modal, DialogTrigger\\n\\nVarianten med ModalTrigger och Dialog är nu utfasad och istället ska DialogTrigger och Modal användas. En aning\\nförvirrande men principen är liknande och den uppdaterade versionen innehåller många förbättringar.\\nSe dokumentationen för [modal](/components/modal) för hur DialogTrigger används.\\n\\n```diff\\n- import {Dialog, ModalTrigger} from \'@midas-ds/components\' // no longer works\\n+ import {DialogTrigger, Modal} from \'@midas-ds/components\'\\n```\\n### Spinner\\n\\nFrån och med 10.0.0 går det inte längre att använda prop `dark`, använd `ìsOnColor` istället.\\n\\n```diff\\n- <Spinner dark/>\\n+ <Spinner isOnColor/>\\n```\\n\\n### Tabs\\n\\nAnvänd `defaultSelectedKey` istället för `defaultSelected`.\\n\\n```diff\\n- <Tabs defaultSelected={1}> /* tab content */ </Tabs>\\n+ <Tabs defaultSelectedKey={1}> /* tab content */ </Tabs>\\n```\\n\\n### Tokens\\n\\nTokens `borderInvalid` ersätts med `supportBorderWarning` och `textInvalid` ersätts med `textWarning`.\\n\\n```diff\\n- semantic.borderInvalid\\n+ semantic.supportBorderWarning\\n- semantic.textInvalid\\n+ semantic.textWarning\\n\\n```\\n\\nTokens `blue140` (`#25607F`) byter namn till `blue130` samt `blue170` (`#143C50`) byter namn till `blue150`, `purple140`\\nbyter namn till `purple110`.\\n\\n```diff\\n- blue140\\n+ blue130\\n- blue170\\n+ blue150\\n- purple140\\n+ purple110\\n```\\n\\n### useMessageFormatter\\n\\n`useMessageFormatter` försvinner till förmån för `useLocalizedStringFormatter` eftersom den är deprecated hos React Aria.\\n\\n```diff\\n- useMessageFormatter()\\n+ useLocalizedStringFormatter()\\n```\\n\\n### Label\\n\\nLabel variant försvinner i version 10.0.0, det går alltså inte längre att använda `variant=\'label-01\'` eller `label-02`.\\nDefault är numera `label-02` och för att uppnå variant `label-01`, använd komponent `Text` med `slot=\'description\'`.\\n\\n```diff\\n- <Label variant=\'label-01\'>Label</Label>\\n+ <Text slot=\'description\'>Label</Label>\\n```\\n\\n### Skeleton\\n\\nNamnfix på prop `rectangular` som numera heter `rectangle` för en mer konsekvent semantik. Animering är numera endast en\\nboolean, `isAnimated=true|false`.\\n\\n```diff\\n- <Skeleton variant=\'rectangular\' animation=\'wave\'/>\\n+ <Skeleton variant=\'rectangle\' isAnimated />\\n```\\n\\nSe alla förändringar i detalj på [changelog](/changelog)\\n\\n{/* truncate */}"},{"id":"/releases/9.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/9.0.0","source":"@site/blog/releases/9.0.0/index.mdx","title":"Release 9.0.0","description":"Migrera från 8.x.x till 9.0.0","date":"2025-05-08T00:00:00.000Z","tags":[],"readingTime":0.93,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 9.0.0","date":"2025-05-08T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.0.0","permalink":"/pr-preview/pr-594/blog/releases/10.0.0"},"nextItem":{"title":"Release 8.0.0","permalink":"/pr-preview/pr-594/blog/releases/8.0.0"}},"content":"## Migrera från 8.x.x till 9.0.0\\n\\n### Card\\n\\nI version 8.3.0 introducerade vi ett nytt och mera modulärt API för `Card`.\\nKomponenten som tidigare accepterade samtliga props är numera en kortyta som måste kompletteras med ett urval från komponenterna `CardContent`, `CardTitle`, `CardActions`, `CardImage`, `CardActionArea` och `CardLink`.\\n\\nFör mer information läs [hur du använder Card](/components/card).\\n\\n### Tokens\\n\\nStrukturen på tokens för `lineHeight` och `size` under `typography` har ändrats.\\nImporterar du dessa värden behöver du justera din kod enligt:\\n\\n#### lineHeight\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n-   typography.lineHeight01\\n+   typography.lineHeight10\\n-   typography.lineHeight02\\n+   typography.lineHeight20\\n-   typography.lineHeight03\\n+   typography.lineHeight30\\n-   typography.lineHeight04\\n+   typography.lineHeight40\\n-   typography.lineHeight05\\n+   typography.lineHeight50\\n-   typography.lineHeight06\\n+   typography.lineHeight60\\n-   typography.lineHeight07\\n+   typography.lineHeight70\\n-   typography.lineHeight08\\n+   typography.lineHeight80\\n-   typography.lineHeight09\\n+   typography.lineHeight90\\n-   typography.lineHeight10\\n+   typography.lineHeight100\\n```\\n\\n#### size\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n\\n-   typography.size01\\n+   typography.fontSize10\\n-   typography.size02\\n+   typography.fontSize20\\n-   typography.size03\\n+   typography.fontSize30\\n-   typography.size04\\n+   typography.fontSize40\\n-   typography.size05\\n+   typography.fontSize50\\n-   typography.size06\\n+   typography.fontSize60\\n-   typography.size07\\n+   typography.fontSize70\\n-   typography.size08\\n+   typography.fontSize80\\n-   typography.size09\\n+   typography.fontSize90\\n-   typography.size10\\n+   typography.fontSize100\\n\\n```\\n\\nKolla [changelog](/changelog/9.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/8.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/8.0.0","source":"@site/blog/releases/8.0.0/index.mdx","title":"Release 8.0.0","description":"Migrera från 7.x.x till 8.0.0","date":"2025-04-15T00:00:00.000Z","tags":[],"readingTime":0.685,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 8.0.0","date":"2025-04-15T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 9.0.0","permalink":"/pr-preview/pr-594/blog/releases/9.0.0"},"nextItem":{"title":"Release 7.0.0","permalink":"/pr-preview/pr-594/blog/releases/7.0.0"}},"content":"## Migrera från 7.x.x till 8.0.0\\n\\n:::warning\\nI version 8.3.0 introducerar vi breaking changes för `Card` som var tänkta för version 9. Vänligen läs release notes för [version 9](/blog/releases/9.0.0) för mer information.\\n:::\\n\\n### Select\\n\\nVärdet i callbacken `onSelectionChange` för komponenten `Select` har ändrats.\\nNumera skickas valda nycklar med en `Selection` type (`\\"all\\" | Set<string | number>`) när användaren justerar sitt val.\\n\\n```diff\\n-   onSelectionChange?: ((value: Selection | Key | Key[]) => void) | undefined\\n+   onSelectionChange?: ((keys: Selection) => void) | undefined\\n```\\n\\nDetta innebär att du behöver hantera om användaren klickar på \\"Välj alla\\" manuellt:\\n\\n```tsx\\nconst handleSelectionChange = (keys: Selection) => {\\n  if (keys === \'all\') {\\n    return setSelection(new Set(options.map(({ id }) => id)))\\n  }\\n  return setSelection(keys)\\n}\\n```\\n\\nFör mer information, läs [instruktioner för `Select` och kontrollerade val](/components/select/#kontrollerade-val)\\n\\nKolla [changelog](/changelog/8.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/7.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/7.0.0","source":"@site/blog/releases/7.0.0/index.mdx","title":"Release 7.0.0","description":"Migrera från 6.x.x till 7.0.0","date":"2025-04-02T00:00:00.000Z","tags":[],"readingTime":0.27,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 7.0.0","date":"2025-04-02T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 8.0.0","permalink":"/pr-preview/pr-594/blog/releases/8.0.0"},"nextItem":{"title":"Release 6.0.0","permalink":"/pr-preview/pr-594/blog/releases/6.0.0"}},"content":"## Migrera från 6.x.x till 7.0.0\\n\\n`TextField` stödjer inte längre `validationType`.\\n\\n### pattern\\n\\nOm du vill använda HTML native constraint validation, använd egenskapen `pattern`.\\nLäs mer om [pattern på MDN](https://developer.mozilla.org/en-US/docs/Web/HTML/Reference/Elements/input#pattern)\\n\\n### validate\\n\\nFör anpassad validering med tillhörande felmeddelande, använd `validate`.\\nLäs mer om egenskapen under vår [dokumentation för TextField](/components/textfield/#egen-validering)\\n\\nKolla [changelog](/changelog/7.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/6.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/6.0.0","source":"@site/blog/releases/6.0.0/index.mdx","title":"Release 6.0.0","description":"- Vi påbörjar utfasning av Dialog, vänligen använd Modal istället.","date":"2025-03-24T00:00:00.000Z","tags":[],"readingTime":0.125,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 6.0.0","date":"2025-03-24T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 7.0.0","permalink":"/pr-preview/pr-594/blog/releases/7.0.0"},"nextItem":{"title":"Release 5.0.0","permalink":"/pr-preview/pr-594/blog/releases/5.0.0"}},"content":"- Vi påbörjar utfasning av `Dialog`, vänligen använd `Modal` istället.\\n- Vi påbörjar utfasning av `ModalTrigger`, vänligen använd `DialogTrigger` istället.\\n\\nKolla [changelog](/changelog/6.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/5.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/5.0.0","source":"@site/blog/releases/5.0.0/index.mdx","title":"Release 5.0.0","description":"Vi introducerar stöd för dark mode på samtliga komponenter","date":"2025-03-17T00:00:00.000Z","tags":[],"readingTime":0.07,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 5.0.0","date":"2025-03-17T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 6.0.0","permalink":"/pr-preview/pr-594/blog/releases/6.0.0"},"nextItem":{"title":"Release 4.0.0","permalink":"/pr-preview/pr-594/blog/releases/4.0.0"}},"content":"Vi introducerar stöd för dark mode på samtliga komponenter\\n\\nKolla [changelog](/changelog/5.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/4.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/4.0.0","source":"@site/blog/releases/4.0.0/index.mdx","title":"Release 4.0.0","description":"Migrera från 3.x.x till 4.0.0","date":"2025-03-10T00:00:00.000Z","tags":[],"readingTime":0.18,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 4.0.0","date":"2025-03-10T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 5.0.0","permalink":"/pr-preview/pr-594/blog/releases/5.0.0"},"nextItem":{"title":"Release 3.0.0","permalink":"/pr-preview/pr-594/blog/releases/3.0.0"}},"content":"## Migrera från 3.x.x till 4.0.0\\n\\n### Select\\n\\n`MultiSelect` ersätts av `Select`, vänligen använd `selectionMode` för en flerväljare:\\n\\n```tsx\\n<Select selectionMode=\'multiple\' />\\n```\\n\\nSe mer information om [hur du använder Select](/components/select)\\n\\nKolla [changelog](/changelog/4.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/3.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/3.0.0","source":"@site/blog/releases/3.0.0/index.mdx","title":"Release 3.0.0","description":"Migrera från 2.x.x till 3.0.0","date":"2025-02-28T00:00:00.000Z","tags":[],"readingTime":0.235,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 3.0.0","date":"2025-02-28T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 4.0.0","permalink":"/pr-preview/pr-594/blog/releases/4.0.0"},"nextItem":{"title":"Release 2.0.0","permalink":"/pr-preview/pr-594/blog/releases/2.0.0"}},"content":"## Migrera från 2.x.x till 3.0.0\\n\\n### SearchField\\n\\n`SearchField` stödjer inte längre `isRequired`. Beteendet kan efterliknas med hjälp av `validate`\\n\\n```tsx\\n<SearchField validate={v => !!v.length || \'Var god ange åtminstone ett tecken\' />\\n```\\n\\nSe mer information om [hur du använder SearchField](/components/search-field)\\n\\nKolla [changelog](/changelog/3.0.0)\\n\\n{/* truncate */}"},{"id":"/releases/2.0.0","metadata":{"permalink":"/pr-preview/pr-594/blog/releases/2.0.0","source":"@site/blog/releases/2.0.0/index.mdx","title":"Release 2.0.0","description":"Migrera från 1.x.x till 2.0.0","date":"2025-02-25T00:00:00.000Z","tags":[],"readingTime":0.105,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 2.0.0","date":"2025-02-25T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 3.0.0","permalink":"/pr-preview/pr-594/blog/releases/3.0.0"}},"content":"## Migrera från 1.x.x till 2.0.0\\n\\n### TextField, TextArea\\n\\n`maxCharacters` byter namn till `maxLength` för enhetlighet\\n\\nKolla [changelog](/changelog/2.0.0)\\n\\n{/* truncate */}"}]}}');

